import { TopicData, Observable } from '../protocols'
import { GetTopicsObserverService } from './GetTopicsObserverService'
import { GetTopicsObserverUseCase } from './GetTopicsObserverUseCase'

function createGetTopicsObserverUseCase(
  service: GetTopicsObserverService,
): GetTopicsObserverUseCase {
  return function (token): Observable<TopicData[]> {
    return service.getTopicsObserver(token)
  }
}

export { createGetTopicsObserverUseCase }
